import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { LoginComponent } from './pages/authPage/login/login.component';
import { SidebarComponent } from './pages/homePage/sidebar/sidebar.component';
import { RegistrationComponent } from './pages/authPage/registration/registration.component';
import { HomePageComponent } from './pages/homePage/homePage.component';
import { HttpClientModule } from '@angular/common/http';

@NgModule({
  declarations: [
    AppComponent,
    LoginComponent,
    SidebarComponent,
    RegistrationComponent,
    HomePageComponent,
    HttpClientModule
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
